<script>

    // Function to toggle dark mode
    function toggleDarkMode() {
      const body = document.querySelector("body");
      body.classList.toggle("dark-mode");

      // Store the user's preference in local storage
      const isDarkMode = body.classList.contains("dark-mode");
      localStorage.setItem("darkMode", isDarkMode);
    }

    // Check if user has a stored preference for dark mode
    const storedDarkMode = localStorage.getItem("darkMode");

    if (storedDarkMode === "true") {
      const body = document.querySelector("body");
      body.classList.add("dark-mode");
    }

  </script>

<script>
    // Function to remove text content containing '23/24'
    function removeText() {
        const elements = document.querySelectorAll('*');
        elements.forEach(element => {
            if (element.children.length === 0) { // Only process elements without children
                if (element.textContent.includes('23/24')) {
                    element.textContent = element.textContent.replace(/23\/24/g, '');
                }
            }
        });
    }

    // Call the function after the DOM is fully loaded
    document.addEventListener('DOMContentLoaded', removeText);

    // Set up a MutationObserver to watch for changes in the DOM
    const observer = new MutationObserver(removeText);

    // Observe changes in the entire document
    observer.observe(document.body, {
        childList: true,
        subtree: true,
        characterData: true
    });
</script>
